            name={"E-mail"}
            inputId={"inputEmail"}
            inputType={"Email"}
            placeholder={"pochta@yandex.ru|"}
          />
          <Input
            name={"Пароль"}
            inputId={"inputPassword"}
            inputType={"password"}
            placeholder={"••••••••••••••"}
          />
      </WindowWithForm>
  )
}
